('https://www.idealista.com/inmueble/25676005/', 'Alquiler de Piso en calle Pico de Pena Golosa', 'Numancia, Madrid', '68 m²   1 hab.   Planta 2ª exterior con ascensor', '625 €/mes', 'Distribución Interior:Vestíbulo, salón-comedor con mirador, cocina con tendedero, un dormitorio con mirador y un cuarto de baño.Carpintería Exterior:Aluminio lacado en color blanco. Acristalamiento doble. Persianas de aluminio.Carpintería Interior:Madera de roble barnizada en puertas de paso y armar', '647 431 358'),
('https://www.idealista.com/inmueble/26558051/', 'Alquiler de Estudio en avenida de los Artesan', 'Zona Industrial, Tres Cantos', '70 m²   Planta 1ª exterior con ascensor   Garaje incluido', '790 €/mes', 'Ideal loft para parejas, totalmente amueblado para entrar a vivir.', '626 220 669'),
('https://www.idealista.com/inmueble/38967458/', ' Casa o chalet independiente en venta en Soto', 'Tres Cantos', '502 m²   7 hab.   Garaje incluido', '1.300.000 €', 'Engel & Völkers presenta esta vivienda unifamiliar de 500 m², con un diseño clásico, en ladrillo visto y granito.La parcela de esta casa, de unos 1500 m², está rodeada de un cuidado jardín, con más de 80 árboles y disponer de una agradable piscina. La zona dispone de seguridad las 24 horas.La casa s', '914 892 842'),
('https://www.idealista.com/inmueble/85199273/', 'Alquiler de Piso en Primera Fase - Nuevo Tres', 'Tres Cantos', '60 m²   1 hab.   Planta 5ª exterior con ascensor   Garaje incluido', '780 €/mes', 'Estupendo apartamento en la primera fase de tres cantos. Tiene una superficie de 60 m2, un dormitorio, un wc, cocina amueblada con electrodomésticos ( frigorífico, lavadora y lavavajillas incluido) tendedero acristalado, salón con terraza y plaza de garaje. Muy buenos cerramientos, persiana automati', '918 041 720'),
