('https://www.idealista.com/inmueble/86782669/', 'Estudio en venta en Zona Industrial', 'Tres Cantos', '152 m²   Planta 1ª exterior con ascensor   Garaje incluido', '275.000 €', 'Precioso loft de 112 m2 mas 40 metros de parcela y una ampliación en la parte de arriba de 24 m2. Tiene dos plantas, la planta central dispone de un wc, una cocina amueblada en muy buen estado, salón y acceso a parcela y la planta de arriba. La segundo zona le loft, la planta de arriba, dispone de t', '918 041 720'),
('https://www.idealista.com/inmueble/87466869/', ' Chalet pareado en venta en Soto de Viñuelas', 'Tres Cantos', '200 m²   5 hab.   Garaje incluido', '575.000 €', '5 habitaciones y 3 baños  cocina equipada  piscina comunitaria y jardín con acceso directo desde la vivienda  para entrar a vivir.', '916 357 442'),
('https://www.idealista.com/inmueble/88976002/', 'Piso en venta en Primera Fase - Nuevo Tres Ca', 'Tres Cantos', '148 m²   4 hab.   Planta 6ª exterior con ascensor   Garaje incluido', '400.000 €', 'Excepcional vivienda con terrazas situada en la primera fase de Tres Cantos. Amplio piso de 148 m2, con cuatro dormitorios, dos cuartos de baños completos, la cocina amueblada con un tendedero, un salón independiente, dos terrazas muy luminosas que recorre el perimetro del piso, una plaza de garaje ', '918 041 720'),
('https://www.idealista.com/inmueble/91763008/', ' Chalet adosado en venta en Soto de Viñuelas', 'Tres Cantos', '157 m²   4 hab.   Garaje incluido', '525.000 €', 'GILMAR MIRASIERRA & PUERTA DE HIERRO presenta este coqueto chalet adosado de esquina en Soto de Viñuelas. Sus 207 m² construidos en total, están repartidos de forma muy práctica y cómoda, con vistas de la sierra desde cada estancia.DISTRIBUCIÓN:En la planta de acceso se encuentra la gran cocina con ', '912 787 208'),
('https://www.idealista.com/inmueble/91958232/', 'Alquiler de Piso en VIZCAYA, 5', 'Palos de Moguer, Madrid', '85 m²   2 hab.   Planta 3ª interior con ascensor', '900 €/mes', 'Se alquila piso amueblado y equipado con todos los electrodomésticos.Dos dormitorios con armarios empotrados, un baño completo, salón comedor. Tranquilo y soleado. Comunidad y calefacción incluida en el precio.Zona cultural al lado del museo reina sofia a cinco minutos del museo del prado muy bien c', '914 877 982'),
('https://www.idealista.com/inmueble/92030072/', 'Piso en venta en EMBARCACIONES', 'Segunda Fase, Tres Cantos', '170 m²   5 hab.   Planta 3ª exterior con ascensor   Garaje incluido', '495.000 €', 'ESPECTACULAR PISO ULTIMA PLANTA en 2ªFase. El moderno piso destaca por acoger un ambiente abierto y espacios funcionales. La reforma integral ofrece un estado impecable de acabados con TODO LUJO DE DETALLES y con CALIDADES DE ALTA GAMA. Una vivienda acogedora donde destacan las paredes lisas blancas', '675 135 493'),
('https://www.idealista.com/inmueble/93363246/', 'Alquiler de Chalet pareado en calle el escudo', 'Soto de Viñuelas, Tres Cantos', '182 m²   3 hab.', '2.975 €/mes', 'PAREADO EN SOTO DE VIÑUELAS TRES CANTOSCasa a estrenar situada en una parcela de 724,74 m2, la parte delantera de la casa tiene jardín y gran porche, en la parte trasera un gran jardín donde está situada la piscina, de agua saladaConsta de dos plantas:La primera planta tiene un amplio salón con coci', '911 798 128');
